import{_ as t,a,b as r}from"./chunks/voxl-2-connectors.4h5HMRIY.js";import{_ as e,c as d,o,ab as l}from"./chunks/framework.CUflZczI.js";const P=JSON.parse('{"title":"ModalAI VOXL 2","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/modalai_voxl_2.md","filePath":"uk/flight_controller/modalai_voxl_2.md"}'),i={name:"uk/flight_controller/modalai_voxl_2.md"},h=l('<h1 id="modalai-voxl-2" tabindex="-1">ModalAI VOXL 2 <a class="header-anchor" href="#modalai-voxl-2" aria-label="Permalink to &quot;ModalAI VOXL 2&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не виробляє цей (або будь-який інший) автопілот. Звертайтесь до <a href="https://forum.modalai.com/" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності.</p></div><p>ModalAI <a href="https://modalai.com/voxl-2" target="_blank" rel="noreferrer">VOXL 2</a> (<a href="https://docs.modalai.com/voxl2-datasheets/" target="_blank" rel="noreferrer">Datasheet</a>) - це наступне покоління автономної обчислювальної платформи ModalAI, побудованої навколо процесора Qualcomm QRB5165. VOXL 2 має 8 ядер, вбудований PX4, сім одночасних камер, бортовий ШІ до 15+ TOPS та підтримку 5G зв&#39;язку. З вагою 16 грамів, VOXL 2 - це майбутнє повністю автономних та підключених дронів!</p><p><img src="'+t+'" alt="VOXL-2"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Цей польотний контролер <a href="./../flight_controller/autopilot_manufacturer_supported.html">підтримується виробником</a>.</p></div><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><h3 id="система" tabindex="-1">Система <a class="header-anchor" href="#система" aria-label="Permalink to &quot;Система&quot;">​</a></h3><table><thead><tr><th>Характеристика</th><th>VOXL 2</th></tr></thead><tbody><tr><td>CPU</td><td>QRB5165 <br>8 ядер до 3.091ГГц <br>8ГБ LPDDR5<br>128ГБ Flash</td></tr><tr><td>OS</td><td>Ubuntu 18.04 - Linux Kernel v4.19</td></tr><tr><td>GPU</td><td>Графічний процесор Adreno 650 - 1024 ALU</td></tr><tr><td>NPU</td><td>15 TOPS</td></tr><tr><td>Налаштування контролера польоту</td><td>Так (датчики DSP, PX4)</td></tr><tr><td>Вбудований WiFi</td><td>Ні</td></tr><tr><td>Додаткове підключення</td><td>WiFi, 5G, 4G/LTE, Microhard</td></tr><tr><td>Кодування відео</td><td>8K30 h.264/h.265 108MP still images</td></tr><tr><td>Датчики комп&#39;ютерного зору</td><td>QTY 6 4-lane CSI, QTY4 CCI (e.g. 2 stereo pair, hires, трекінг)</td></tr><tr><td>Датчик трекінгу</td><td>Так</td></tr><tr><td>Розміри</td><td>70мм х 36мм</td></tr><tr><td>Вага</td><td>16г</td></tr><tr><td>VOXL SDK: навігація без GPS, SLAM, уникання перешкод, розпізнавання об&#39;єктів</td><td>Так</td></tr><tr><td>ROS</td><td>ROS 1 &amp; 2</td></tr><tr><td>QGroundControl</td><td>Так</td></tr><tr><td>ATAK</td><td>Так</td></tr><tr><td>Сумісний з NDAA ’20 Section 848</td><td>Так, зібрано в США</td></tr><tr><td>PMD TOF</td><td>Так (SDK 1.0 та новіше)</td></tr><tr><td>FLIR Boson</td><td>USB</td></tr><tr><td>FLIR Lepton</td><td>USB, SPI</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Докладнішу документацію щодо апаратного забезпечення можна знайти <a href="https://docs.modalai.com/voxl-flight-datasheet/" target="_blank" rel="noreferrer">тут</a>.</p></div><h2 id="розміри" tabindex="-1">Розміри <a class="header-anchor" href="#розміри" aria-label="Permalink to &quot;Розміри&quot;">​</a></h2><h3 id="_2d-розмір" tabindex="-1">2D розмір <a class="header-anchor" href="#_2d-розмір" aria-label="Permalink to &quot;2D розмір&quot;">​</a></h3><p><img src="'+a+'" alt="VOXL2Dimensions"></p><h3 id="_3d-розміри" tabindex="-1">3D розміри <a class="header-anchor" href="#_3d-розміри" aria-label="Permalink to &quot;3D розміри&quot;">​</a></h3><p><a href="https://storage.googleapis.com/modalai_public/modal_drawings/M0054_VOXL2_PVT_SIP_REVA.step" target="_blank" rel="noreferrer">Файл 3D STEP</a></p><h2 id="сумісність-прошивки-px4" tabindex="-1">Сумісність прошивки PX4 <a class="header-anchor" href="#сумісність-прошивки-px4" aria-label="Permalink to &quot;Сумісність прошивки PX4&quot;">​</a></h2><h3 id="гілка-voxl-dev" tabindex="-1">гілка voxl-dev <a class="header-anchor" href="#гілка-voxl-dev" aria-label="Permalink to &quot;гілка voxl-dev&quot;">​</a></h3><p>ModalAI активно підтримує <a href="https://github.com/modalai/px4-firmware/tree/voxl-dev" target="_blank" rel="noreferrer">гілку версії PX4</a>, яку можна використовувати.</p><p>Оскільки VOXL 2 працює під управлінням Ubuntu, виробничі версії PX4 для VOXL 2 розповсюджуються через <a href="https://docs.modalai.com/configure-pkg-manager/" target="_blank" rel="noreferrer">apt пакетний менеджер</a> та <a href="https://docs.modalai.com/voxl-sdk/" target="_blank" rel="noreferrer">VOXL SDK</a>.</p><p>Додаткову інформацію про прошивку можна знайти <a href="https://docs.modalai.com/voxl2-px4-developer-guide/" target="_blank" rel="noreferrer">тут</a>.</p><h3 id="основна-гілка" tabindex="-1">основна гілка <a class="header-anchor" href="#основна-гілка" aria-label="Permalink to &quot;основна гілка&quot;">​</a></h3><p>Підтримка основної лінії PX4 для VOXL 2 (документація плати <a href="https://github.com/PX4/PX4-Autopilot/tree/release/1.15/boards/modalai/voxl2" target="_blank" rel="noreferrer">тут</a>).</p><h2 id="підтримка-qgroundcontrol" tabindex="-1">Підтримка QGroundControl <a class="header-anchor" href="#підтримка-qgroundcontrol" aria-label="Permalink to &quot;Підтримка QGroundControl&quot;">​</a></h2><p>Ця плата підтримується QGroundControl 4.0 та пізнішими версіями.</p><h2 id="доступність" tabindex="-1">Доступність <a class="header-anchor" href="#доступність" aria-label="Permalink to &quot;Доступність&quot;">​</a></h2><ul><li><a href="https://www.modalai.com/products/px4-autonomy-developer-kit" target="_blank" rel="noreferrer">Автономний набір розробника PX4</a></li><li><a href="https://www.modalai.com/products/starling-2" target="_blank" rel="noreferrer">Starling 2</a></li><li><a href="https://www.modalai.com/products/starling-2-max" target="_blank" rel="noreferrer">Starling 2 MAX</a></li><li><a href="https://www.modalai.com/pages/sentinel" target="_blank" rel="noreferrer">Sentinel Development Drone, працює на VOXL 2</a><ul><li><a href="https://www.youtube.com/watch?v=hMhQgWPLGXo" target="_blank" rel="noreferrer">Демо відео</a></li></ul></li><li><a href="https://www.modalai.com/collections/ready-to-mount/products/voxl-2-flight-deck" target="_blank" rel="noreferrer">VOXL 2 Flight Deck, готовий до встановлення, налаштування і польоту</a></li><li><a href="https://www.modalai.com/products/voxl-2" target="_blank" rel="noreferrer">VOXL 2 Набори розробки</a><ul><li><a href="https://www.youtube.com/watch?v=aVHBWbwp488" target="_blank" rel="noreferrer">Відео-демонстрація</a></li></ul></li></ul><h2 id="швидкии-старт" tabindex="-1">Швидкий старт <a class="header-anchor" href="#швидкии-старт" aria-label="Permalink to &quot;Швидкий старт&quot;">​</a></h2><p>Quickstarts від постачальника розташовані <a href="https://docs.modalai.com/voxl2-quickstarts/" target="_blank" rel="noreferrer">тут</a>.</p><h3 id="voxl-sdk" tabindex="-1">VOXL SDK <a class="header-anchor" href="#voxl-sdk" aria-label="Permalink to &quot;VOXL SDK&quot;">​</a></h3><p>VOXL SDK (Набір розробки програмного забезпечення) складається з відкритих <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">voxl-px4</a>, <a href="https://docs.modalai.com/core-libs/" target="_blank" rel="noreferrer">core бібліотек</a>, <a href="https://docs.modalai.com/mpa-services/" target="_blank" rel="noreferrer">сервісу</a>, <a href="https://docs.modalai.com/inspect-tools/" target="_blank" rel="noreferrer">інструментів</a>, <a href="https://docs.modalai.com/sdk-utilities/" target="_blank" rel="noreferrer">утиліт</a> та <a href="https://docs.modalai.com/build-environments/" target="_blank" rel="noreferrer">середовищ розробки</a>, які ModalAI надає для прискорення використання та розвитку обчислювальних плат і аксесуарів VOXL.</p><p>VOXL SDK працює на VOXL, VOXL 2 та RB5 Flight!</p><p>Вихідний код для проєктів у межах VOXL SDK можна знайти на <a href="https://gitlab.com/voxl-public" target="_blank" rel="noreferrer">https://gitlab.com/voxl-public</a>, поруч з інструкціями зі збірки.</p><h3 id="з-єднання" tabindex="-1">З’єднання <a class="header-anchor" href="#з-єднання" aria-label="Permalink to &quot;З’єднання&quot;">​</a></h3><p>Детальну інформацію про роз&#39;єми можна знайти <a href="https://docs.modalai.com/voxl2-connectors/" target="_blank" rel="noreferrer">тут</a> разом з <a href="https://www.youtube.com/watch?v=xmqI3msjqdo" target="_blank" rel="noreferrer">відеооглядом тут</a></p><p><img src="'+r+'" alt="VOXLConnectors"></p><p>Усі односторонні сигнали на роз&#39;ємах B2B J3, J5, J6, J7 та J8 є 1,8В CMOS, якщо явно не вказано інше. Усі односторонні сигнали на кабель-плата роз&#39;ємах J10, J18, &amp; J19 є 3,3В CMOS, якщо явно не вказано інше.</p><table><thead><tr><th>З’єднання</th><th>Опис</th><th>MPN (Сторона плати)</th><th>З&#39;єднання MPN (сторона плати/кабелю)</th><th>Тип</th><th>Загальний опис функцій сигналізації</th></tr></thead><tbody><tr><td>J2</td><td>Охолодження</td><td>SM02B-SRSS-TB(LF)(SN)</td><td>SHR-02V-S</td><td>Cable Header, 2-pin R/A</td><td>5V DC для вентилятора + регулювання FAN-повернення (GND)</td></tr><tr><td>J3</td><td>Legacy B2B</td><td>QSH-030-01-L-D-K-TR</td><td>QTH-030-01-L-D-A-K-TR</td><td>B2B накопичувач, 60-pin</td><td>5V/3.8V/3.3V/1.8V живлення для плати, JTAG і Debug Signals QUP expansion, GPIOs, USB3.1 Gen 2 (USB1)</td></tr><tr><td>J4</td><td>Максимальна потужність</td><td>22057045</td><td>0050375043</td><td>Конектор, 4-pin R/A</td><td>+5В основний постійний струм + GND, I2C@5V для живлення моніторів</td></tr><tr><td>J5</td><td>Високошвидкісне підключення плата-плата (B2B)</td><td>ADF6-30-03.5-L-4-2-A-TR</td><td>ADM6-30-01.5-L-4-2-A-TR</td><td>B2B Роз&#39;єм, 120-pin</td><td>Більше потужності 3.8V/3.3V/1.8V для встановлюваних плат, потужність 5V для режиму «SOM», розширення QUP, GPIO (включно з I2S), SDCC (SD Card V3.0), UFS1 (другорядна UFS Flash), 2L PCIe Gen 3, AMUX та сигнали SPMI PMIC</td></tr><tr><td>J6</td><td>Група камери 0</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI порти CSI, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділених порту SPI (QUP)</td></tr><tr><td>J7</td><td>Група камери 1</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI CSI порти, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділений порт SPI (QUP)</td></tr><tr><td>J8</td><td>Група камери 2</td><td>DF40C-60DP-0.4V(51)</td><td>DF40C-60DS-0.4V</td><td>B2B плагін, 60-пін</td><td>Qty-2 4L MIPI порти CSI, сигнали управління CCI і камери, 8 рейок живлення (від 1.05-V до 5V) для камер і інших сенсорів, виділений порт SPI (QUP)</td></tr><tr><td>J9</td><td>USB-C (ADB)</td><td>UJ31-CH-3-SMT-TR</td><td>USB Type-C</td><td>Кабель-з&#39;єднувач, 24-pin R/A</td><td>ADB USB-C з перезапуском та альтернативним режимом відображення порту (USB0)</td></tr><tr><td>J10</td><td>Розширення SPI</td><td>SM08B-GHS-TB(LF)(SN)</td><td>GHR-08V-S</td><td>Конектор, 8-pin R/A</td><td>SPI@3.3V з 2 CS_N пінами, 32kHz CLK_OUT@3.3V</td></tr><tr><td>J18</td><td>ESC (Доступ SLPI)</td><td>SM04B-GHS-TB(LF)(SN)</td><td>GHR-04V-S</td><td>Конектор, 4-pin R/A</td><td>ESC UART@3.3V, опорна напруга 3.3V</td></tr><tr><td>J19</td><td>GNSS/MAG/RC/I2C (доступ SLPI)</td><td>SM12B-GHS-TB(LF)(SN)</td><td>GHR-12V-S</td><td>Конектор, 6-pin R/A</td><td>GNSS UART@3.3V, Магнетометр I2C@3.3V, 5V, RC UART, Запасна I2C</td></tr></tbody></table><h3 id="посібник-користувача" tabindex="-1">Посібник користувача <a class="header-anchor" href="#посібник-користувача" aria-label="Permalink to &quot;Посібник користувача&quot;">​</a></h3><p>Посібник користувача PX4 для VOXL 2 доступний <a href="https://docs.modalai.com/voxl-px4/" target="_blank" rel="noreferrer">тут</a>.</p><h3 id="інструкція-розробника" tabindex="-1">Інструкція розробника <a class="header-anchor" href="#інструкція-розробника" aria-label="Permalink to &quot;Інструкція розробника&quot;">​</a></h3><p>The Посібник розробника PX4 для VOXL 2 доступний <a href="https://docs.modalai.com/voxl-px4-developer-guide/" target="_blank" rel="noreferrer">тут</a>.</p><h3 id="як-зібрати" tabindex="-1">Як зібрати <a class="header-anchor" href="#як-зібрати" aria-label="Permalink to &quot;Як зібрати&quot;">​</a></h3><p>Дивіться <a href="https://docs.modalai.com/voxl2-px4-build-guide/" target="_blank" rel="noreferrer">VOXL PX4 Посібник зі збірки</a> щодо збірки.</p><h2 id="підтримка" tabindex="-1">Підтримка <a class="header-anchor" href="#підтримка" aria-label="Permalink to &quot;Підтримка&quot;">​</a></h2><p>Будь ласка, відвідайте <a href="https://forum.modalai.com/category/26/voxl-2" target="_blank" rel="noreferrer">Форум ModalAI</a> для отримання додаткової інформації.</p>',44),n=[h];function s(c,p,m,b,f,u){return o(),d("div",null,n)}const g=e(i,[["render",s]]);export{P as __pageData,g as default};
